&bull  What Are CineSkates? <br><br> &bull  CineSkates are a set of three wheels that quickly attach to a tripod and enable fluid  rolling video in an ultra-portable package. CineSkates work specifically with the GorillaPod Focus tripod. <br><br> &bull  What Makes CineSkates So Cool? <br><br> &bull  CineSkates can produce shots that have previously been impossible or only possible with bulky and expensive equipment. Here are a few: <br><br> &bull  Arcing shots that rotate around objects <br> &bull  Sliding shots that push or pull the subject into focus <br> &bull  Rolling shots that glide over the subject <br> &bull  Time-lapse shots that move the camera slowly and smoothly <br> &bull  Panning shots that scan a wide area <br> &bull  ''Worm's eye view'' shots that slide just above the floor <br><br> &bull  Perfect For: weddings  music videos  product demos  real estate ads  web videos corporate films  narrative and documentary films. <br><br><br><br></DIV>
