Compatibility:Cullmann Arca-Swiss-Style<br>Construction:Aluminum<br>Dimensions (H x W x D):0.43 x 2.05 x 5.91'' (11 x 52 x 150mm)<br>Weight:0.21 lb (95 g)<br><br><br>・Slides for Optimal Camera Balance<br>・Arca-Swiss-Style Compatible<br>・Anti-Twist Pins for Portrait Orientation<br>・Cast Aluminum Construction<br><br><br>The Cullmann Magnesit MX496 Sliding Quick-Release Plate - 5.91'' Long is a cast-aluminum quick-release plate that features Arca-Swiss-style grooves for attachment to a compatible quick-release assembly. By sliding the plate forward and back in the clamp  you can achieve proper balance for your camera. The plate has two camera-fixing pins for increased camera stability in portrait mode  as well as mounting for Cullmann's CX678 bubble level. A flip-up thumbscrew enables tight fastening of the plate to the camera. A metric ruler on the side facilitates precise adjustments.<br><br></DIV>
