Materials:Aluminum Alloy<br>Ball Diameter:33mm<br>Ballhead Height:101mm<br>Weight:.45kg<br>Capacity:25kg<br><br><br>・CNC forged aluminum construction<br>・Separate knobs for directional control and locking<br>・Safe-spring quick release plate<br>・33mm diameter floating ballhead<br>・State of the art hydraulic dampening<br>・Exceptionally high load-bearing capacity to 55lbs.<br>・Positioning dial included on base<br>・1.5 pounds of precision<br>・Patented Rapid Lock System<br>・Versatile exclusive QR Plate with buckle loop<br><br><br>The H5 ballhead from 3POD is designed to Ultramax durability and to max 55lb support. <br><br> &bull  The innovative H5 aluminum ballhead from 3POD's H series employs an advanced hydraulic damping system for silky smooth movement. The 33mm ball floats in a superhard CNC forged aluminum shell  and is the prime choice for heavy-duty imaging devices with a supported payload of up to an amazing 55lbs. The smooth movement of the ball itself is controlled with adjustment knobs  and the panningbase features 360? of movement with a highly visible positioning dial  perfect for techniques like panoramic splicing where exactness is a must. <br><br> &bull  The included patented rapid locking quick release sliding plate system  features an adjustable locking force  universal ?'' mounting screw suitable for cameras of all sizes and locks independently to the body of the ballhead for a secure  protective mount. The quick release includes a hexagon wrench. <br><br> &bull  The H5 can be fastened to a tripod body or center column for a wide variety of projects  or can be used alone as a tabletop mount for close-range photography.</DIV>
