Material:Carbon Exact<br>Attaches by:1/4'' and 3/8'' Screws Attachment Type<br>Leg Angles:24deg.  55deg.  82deg.<br>Level:Standard<br>Series:1<br>Centre Column:Rapid<br>Leg Sections:4<br>Load Capacity:22.04lbs (10.00kg)<br>Height:Minimum: 5.91'' (15.01cm)<br>Maximum: 62.60'' (159.00cm)<br>Maximum Height (with Centre Column Down): 53.15'' (135.00cm)<br>Closed Length:21.26'' (54.00cm)<br>Weight:2.82lbs (1.27kg)<br><br><br>The Gitzo GT1542 Mountaineer Series 1 Carbon Fiber 4 Sections Tripod features Carbon exact tubing  which includes High Modulus carbon fiber in the lower leg sections  adding to their diameters and making the tripod more rigid and stronger than its predecessor. The GT1542 has a load capacity of 22.04 lbs  extends to a maximum height of 62.6'' and folds down to 21.3'' for transport. <br><br>The center column on the tripod can be removed for Ground Level Set  which enables the tripod to reach its lowest height of 5.9''. Its four-section legs are secured with twist locks that incorporate G-lock Ultra  which has an internal O-ring to prevent dust and particles from entering the leg system. The top spider has been redesigned to add rigidity and large leg angle selectors give you more area to grip when readjusting leg angles. A ballast hook on the center column allows you to add weight to increase the tripod's stability. <br><br><b> Reversible Column </b><br> The rapid column can easily be inverted for an alternative shooting angle or low level macro work. <br><br><b> Hook </b><br> This built-in accessory allows you to hang a stabilizing weight (e.g. a full camera bag or a sand/water bag) from the bottom of the tripod centre column. It is useful with long/heavy lenses  on uneven ground or in windy conditions. <br><br><b> Carbon Exact </b><br> Revolutionary Carbon exact tubes are even stiffer to maximize rigidity and image stability. Carbon exact optimizes the fibre composition for each tube size  using HM (High Modulus) carbon fibre in the narrower tubes to make them stiffer. The tube diameters are also optimized: the final leg section of a 4 section Series 1 tripod is now 22.5% thicker than its predecessor. <br><br><b> G-lock Ultra </b><br>It has been redesigned from the inside out  G-lock Ultra is smoother and softer to use and is designed to reduce dust and grit from getting in. <br><br><b> Ground Level Set (with Unlocking Ring) </b><br>The Ground Level Set mechanism permits to remove the centre column to get the camera closer to the ground. A single simple unlocking ring under the column's upper disc frees the column while keeping the upper disc solidly in place on the tripod (Patent Pending). <br><br><b> Leg Angle Selector with Spring </b><br> Offers large grip space and features a built-in spring to help speed up switches between the 3 leg angles.<br><br></DIV>
