Size:45'' / 114.3 cm<br><br><br>Matthews Studio Equipment complements your creativity with Matthews 45'' Slider  a camera platform that is extremely sturdy and lightweight owing to its innovative open frame construction. It is both camera operator and grip friendly  being virtually maintenance free (just keep it clean) and totally field adjustable with few basic tools  one 7/16'' open wrench and a set of Allen wrenches.<br><br>It can work upside-down for low-angle shots  can support more than one carriage at a time for A and B camera shots and it has positive lock at 90 degrees when in use on most dollies (Chapman  Fisher  Panther  etc.). Each carriage can support up to 175lbs (80kg) - bracing of tracks might be necessary. The system uses proprietary wheels with ABEC5 stainless bearings with ceramic balls which make it very fast and extremely quiet.</DIV>
