Material::Carbon Fiber<br>Tripod/Head: Maximum Height:67.25''<br>Tripod/Head: Minimum Height:32''<br>Tripod/Head: Closed Length:36.5''<br>Tripod Legs: Weight:16.8 lbs total Weight<br>Tripod Legs: Bowl Adapter:100mm 4'' Half Ball<br>Tripod Legs: Spreader/Brace:Mid-Level Spreader<br>Tripod Head: Type:Laser : <br> Fluid Damping System <br> Variable Counterbalance<br>Tripod Head: Weight:7.lb<br>Tripod Head: Load Capacity:22 lbs /10 kg<br>Tripod Head: Pan / Tilt:with 1 Telescopic Pan Bar<br>Balance Plate::Sliding Plate<br>Pan/Tilt Range::360°  -90/+90°<br>Pan/Tilt Drag::Continuously Adjustable<br>Leg Sections/Stages:2 Stage<br>Illuminated Leveling Bubble:Yes<br><br><br>Built of magnesium and aluminum alloy  the LASER is a very compact and lightweight Fluid Head designed for portable DIGITAL CAMERAS weighing up to 10 Kg. (22 lbs). <br><br> Featuring an infinitely variable counterbalance  the LASER provides for excellent performances at any tilt position from +90 to 90 degrees. The continuously variable fluid control system ensures consistent drag levels and smooth camera movements on both pan and tit modes. <br><br> The LASER comes equipped with a 100 mm bowl base  telescopic pan bar and illuminated spirit level. A wide range of ENG tripods are available both in aluminum or carbon fiber version with either single or double stage extension. <br><br><br><br></DIV>
