Dimensions:L: 102mm x H: 102mm x W: 102mm<br>Compatibility:If your camera has a remote input such as for a timer remote then it will be compatible with the Genie.<br>Power:Lith-Ion Battery 1.1volt <br>Power Supply: Input: 110v / 244v 50/60hz AC <br>Output: 15v 1.5a DC <br>Battery Life time: 12 hour run time  based on a time lapse recording running for 12 hours. Battery life will vary according to other factors  such as how much weight is used on the device  whether its used in time lapse or video modeand whether the Genie is being used on moves on an incline<br>Specifications::Maximum Speed in Video Mode: <br> Linear: 100 cm / 45 sec <br> Panning: 360 degrees / 5 sec <br><br><br><br>・An all-in-one device! No external batteries  controllers or loose wires - meaning that the Genie can be a part of your regular camera kit.<br><br><br>The Genie! A simple  affordable and extremely easy to use device used for motioncontrol and image capture for Time Lapse Photography + more. The key to the Genie is that it can be used with any existing film equipment apparatus on the market including Tripods  Sliders  Jib Arms  cable cams or evenyour office chair! Flick through the features.</DIV>
