ngeover  so camera operators can go from using the tripod to shooting from the shoulder within a matter of seconds. In combination with fluid heads FSB 2 and FSB 6  this tripod system is ideal for MiniDV camcorders starting from around 1 kg / 2.2 lbs.</DIV>
